import React from 'react';
import Tweet from "./tweet";

function App () {
  return (
    <div className="app">
    <Tweet name="Ula" message="hello women!" />
    <Tweet name="Mateusz" message="hello men!"/>
    <Tweet name="Jan"  message="hello kids!"/>
    <Tweet name="Maja" message="hello dogs!"/>
    </div>
  );
}

export default App;
